import React from 'react';
import '../index.css';

function Card(props) {
  return (
    //<template id="element-template">
        <div className="element">
            <button type="button" aria-label="Удалить" className="element__trash"></button>
            <img className="element__image" src={props.src} alt={props.alt}/>
            <div className="element__group">
                <h2 className="element__text">{props.cardName}</h2>
                <div className="element__likes">
                    <button type="button" aria-label="Нравится" className="element__like"></button>
                    <div className="element__count">{props.likes.length}</div>
                </div>
            </div>
        </div>
    //</template>
  );
}

export default Card;
